import React from 'react';
import './LoginPage.css';
import './App.css';
import { useNavigate } from 'react-router-dom';
import BackButton from './BackButton';

function LoginPage() {

  return (
    <div className = "login">
      <div className = 'title'>
        Log In
      </div>
      <BackButton></BackButton>
    </div>
  );
}

export default LoginPage;
